      <form>
        <label for="fname">Mobile no.</label>
        <input
          type="number"
          id="fname"
          name="firstname"
          placeholder="Your name.."
        />

        <input type="submit" value="Submit" />
      </form>
    </div>
  );
};

export default Forgot;
